import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { useState,useEffect } from 'react';
import { useNavigate } from 'react-router';


const RegisterFormPage = () => {
  const navigate = useNavigate();
  const initialData = Object.freeze({
    userName:"",
    email:"",
    password:""
  });

  const[allData,setAlldata] = useState(initialData);

  const valueChange = (e) => {
      setAlldata({
      ...allData,
      [e.target.name]:e.target.value.trim()
    });
  }
  console.log('all data' , allData)

 const getData = "data passed successfully!"
  const registerData = (e) => {
    e.preventDefault();
    navigate('/loginPrivate',{state:{getData}});

  }

  // useEffect(() => {
  //   localStorage.setItem('list',JSON.stringify(allData))
  // },[allData])
    return(
        <>
         <Box
      sx={{
        display: 'flex',
        flexDirection: 'column',
        alignItems:'center',
        '& .MuiTextField-root': { width: '25ch' },
      }}
    >
      <h1>Welcome to Sign up Page:</h1>
      <TextField type="text" label={'Name="username"'} id="margin-normal" margin="normal"  onChange={valueChange}/>
      <TextField type="email" label={'Email="email"'} id="margin-normal" margin="normal" onChange={valueChange}/>
      <TextField type="password" label={'Password="password"'} id="margin-normal" margin="normal" onChange={valueChange}/>
      <Button variant="contained" onClick={registerData}>Register</Button>
      <h2>OR</h2>
      <Button variant="contained">Log In</Button>
    </Box>
        </>
    )
}

export default RegisterFormPage;
